import "./Autok.css";
import React from "react";


class Autok extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        autok: []
      };
    }
  
    componentDidMount() {
      fetch("http://localhost:5000/api/auto/autok")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              autok: result
            });
          },
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }
  
    render() {
      const { error, isLoaded, autok } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        const Rendel = (e) => {
          e.preventDefault();
          const marka = document.getElementById("marka").value;
          const ar = document.getElementById("ar").value;
          const uzemanyag = document.getElementById("uzemanyag").value;
          const szin = document.getElementById("szin").value;
          const rendeloemail = document.getElementById("rendeloemail").value;
          const szemelyiszam = document.getElementById("szemelyiszam").value;
          const databody = { marka, ar,uzemanyag ,szin,rendeloemail,szemelyiszam };
          fetch("http://localhost:5000/api/rendeles/feltolt", {
            method: "POST",
            body: JSON.stringify(databody),
            headers: {
              "Content-Type": "application/json",
            },
          })
          .then(res => res.json())
          .then(data => console.log(data))
          .catch((error) => console.log(error.message));

          console.log(databody);
          
        };
        
        return (
          <form className="pageautok" onSubmit={Rendel}>
            <ul>
              {autok.map(auto => (
                
              <li  id="auto" key={auto._id}>
                  <img id="kep" src={require("../../public/kepek/" + auto.kep)} alt={auto.kep} /><br />
                  <p>Marka: {auto.marka}</p>
                  <p>Uzemanyag: {auto.elektromos}</p >
                  <p>Ára: {auto.ar} ft.</p >
                  <input className="hidden" type="text" id="marka" value={auto.marka}/>
                  <input className="hidden" type="text" id="uzemanyag" value={auto.elektromos}/>
                  <input className="hidden" type="text" id="ar"  value={auto.ar}/>
                  <select  id="szin" >szin
                    <option value="fekete">fekete</option>
                    <option value="szurke">szurke</option>
                    <option value="kek">kek</option>
                    <option value="zold">zold</option>
                    <option value="piros">piros</option>
                  </select> <br /><br />
                  <input type="email" id="rendeloemail" placeholder="email..."/> <br /> <br />
                 <input type="text" id="szemelyiszam" placeholder="szemelyi szam..."/> <br /><br />
                 <button type="submit">Rendeles</button>
                
               
              </li>
           ))}
          </ul>
          </form>
          
        ); 
      }
    }
  }
export default Autok;
